import React, { Component } from 'react';
import styled from 'styled-components'
import { connect } from 'react-redux';

const GetStartedDiv = styled.div`
    color: white;
    width: 100%;   
    text-align: right;
    margin-top: 115px;
    padding: 16px;
    background-color: rgba(20, 18, 24, 0.75);
    font-size: 24px;
    box-sizing: border-box;	
`;

const FlexChild = styled.div`
    position: relative;
    width: 49%;
	width: ${props => props.width || ''};  
    box-sizing: border-box; 
    
	@media screen and (max-width: 1190px) {
		margin: 20px 5px;
		min-width: 98%;
	}
`;
const BlackDiv = styled.div`
    width: 100vw;
    height: 100vh;
    background-color: rgba(20, 18, 24, 0.50);
`;
const Block = styled.div`
    position: absolute;
    padding: 16px;
    top: 50%;
    left: calc(50% - 300px);
    z-index: 9999;
    width: 600px;
    border-radius: 4px;
    background-color: white;
    text-align: center;
    box-sizing: border-box;
  
`;

const Error = styled.div`
    margin: 28px auto 16px auto;
    width: 64px;
    height: 64px;
    border-radius: 50%;
    border: 1px solid #E62416;
    text-align: center;
    line-height: 64px;
    color: #E62416;
`;

const TextSpan = styled.div`
    color: #100529;
    padding-bottom: 8px;
    border-bottom: 1px solid #D6D6D6;
`;

const Button = styled.div`
    display: inline-block;
    margin-top: 40px;
    width: ${props => props.width || '126px'}
    padding: 10px 0;
    margin: 40px 8px;
    border-radius: 4px;
    background-color: ${props => props.color || '#4F9DA6'} 
    color: white;
`;

const Close = styled.button`
    width: 40px;
    height: 40px;
    border: 1px solid #E7E7E7;
    box-shadow: 0 3px 6px  rgba(0, 0, 0, 0.16);
    background-color: transparent;
    color: rgba(230, 36, 22, 1);
    font-size: 24px;
`;
const CloseDiv = styled.div`
    text-align: right;
`;
class PopUpDelete extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}

    render() {
		return (
            <Block>
                <CloseDiv>
                    <Close>X</Close>
                </CloseDiv>
                <Error>!</Error>
                <TextSpan>Are You sure?</TextSpan>
                <Button color={'#E62416'} width={'179px'}>Yes, delete it</Button>
                <Button>Cancel</Button>
            </Block>
        );
	}
}

function mapStateToProps(state) {
	return {
	
	}
}

export default connect(mapStateToProps, null)(PopUpDelete)
